import React, { useState } from "react";

const SortButton = ({ handleSortAscend, handleSortDescend }) => {
  return (
    <div>
      <div>
        <span>並び替え</span>
        <button onClick={() => handleSortAscend()}>登録順：昇順</button>
        <button onClick={() => handleSortDescend()}>登録順：降順</button>
      </div>
    </div>
  );
};

export default SortButton;
